def choice(x:str, y:str)->str:
    a = {
        "X": "Z",
        "Y": "X",
        "Z": "Y",
    }
    b = {
     "X": "X",
     "Y": "Y",
     "Z": "Z",
 }
    c = {
     "X": "Y",
     "Y": "Z",
     "Z": "X",
 }
    if x == "A":
        return a[y]
    if x == "B":
        return b[y]
    if x == "C":
        return c[y]

def powers(x:str, y:str)->int:
    """A function to determine the powers of each pull,
    and calculate the points after each round"""

    win_points = 6
    draw_points = 3

    rock = 1
    paper = 2
    scissors = 3

    wins = {
        "A": ["Y", win_points + paper],
        "B": ["Z", win_points + scissors],
        "C": ["X", win_points + rock],
    }

    draws = {
        "A": ["X", draw_points + rock],
        "B": ["Y", draw_points + paper],
        "C": ["Z", draw_points + scissors],
    }

    losses = {
        "X": rock,
        "Y": paper,
        "Z": scissors,
    }

    if(wins[x][0] == y):
        return wins[x][1]
    elif(draws[x][0] == y):
        return draws[x][1]
    else:
        return losses[y]

